import Before from "assets/img/gridlist/before.png";
import After from "assets/img/gridlist/before.png";

const tileData = [
	{
      img: Before,
      title: 'Before',
      author: 'Before',
      cols: 2,
    },
    {
      img: After,
      title: 'After',
      author: 'After',
      cols: 2,
    },
]

export default tileData;
